# temporary font file from base64 
def load_font_from_base64(font_base64_str, font_filename):
    font_bytes = base64.b64decode(font_base64_str)
    
    # temporary directory
    temp_dir = os.path.join(os.getcwd(), 'temp_fonts')
    if not os.path.exists(temp_dir):
        os.makedirs(temp_dir)
    
    font_path = os.path.join(temp_dir, font_filename)
    try:
        with open(font_path, "wb") as font_file:
            font_file.write(font_bytes)
    except PermissionError as e:
        print(f"PermissionError: {e}")
        print("Trying an alternative temporary directory.")
        
        temp_dir = tempfile.mkdtemp()
        font_path = os.path.join(temp_dir, font_filename)
        with open(font_path, "wb") as font_file:
            font_file.write(font_bytes)
    
    return font_path

