# Global variables for storing the x and y coordinates of the selected region (from the rectangle tool)
start_x, start_y, end_x, end_y, rectangle = None, None, None, None, None


#Uses rectangle tool to capture an area and get x and y coordinates
def capture_region():
    global start_x, start_y, end_x, end_y, rectangle

    def on_mouse_down(event):
        global start_x, start_y, rectangle
        start_x, start_y = event.x_root, event.y_root
        rectangle = canvas.create_rectangle(start_x, start_y, start_x, start_y, outline='red', width=3, tag='selection')

    def on_mouse_drag(event):
        current_x, current_y = event.x_root, event.y_root
        canvas.coords(rectangle, start_x, start_y, current_x, current_y)

    def on_mouse_up(event):
        global start_x, start_y, end_x, end_y
        end_x, end_y = event.x_root, event.y_root

        # Make sure the rectangle coordinates are top-left to bottom-right (otherwise it messes up because the values can be negative)
        if start_x > end_x:
            start_x, end_x = end_x, start_x
        if start_y > end_y:
            start_y, end_y = end_y, start_y

        x1_entry.delete(0, tk.END)
        y1_entry.delete(0, tk.END)
        x2_entry.delete(0, tk.END)
        y2_entry.delete(0, tk.END)
        x1_entry.insert(0, str(start_x))
        y1_entry.insert(0, str(start_y))
        x2_entry.insert(0, str(end_x))
        y2_entry.insert(0, str(end_y))

        canvas.destroy()
        capture_window.destroy()

    capture_window = tk.Toplevel(root)
    capture_window.attributes('-fullscreen', True)
    capture_window.attributes('-alpha', 0.3)
    capture_window.configure(bg='gray')

    canvas = tk.Canvas(capture_window, cursor='cross', bg='gray', highlightthickness=0)
    canvas.pack(fill='both', expand=True)
    canvas.bind('<ButtonPress-1>', on_mouse_down)
    canvas.bind('<B1-Motion>', on_mouse_drag)
    canvas.bind('<ButtonRelease-1>', on_mouse_up)
    
    
#function to decode the base64 of the PageRaven Page 
def decode_and_save_brand_page(base64_string, output_folder, output_format):
    image_data = base64.b64decode(base64_string)
    image = Image.open(io.BytesIO(image_data)).convert('RGB')
    
    if output_format == 'PDF':
        brand_image_path = os.path.join(output_folder, "brand_page.pdf")
        image.save(brand_image_path, "PDF", resolution=100.0)
    elif output_format == 'TXT':
        brand_image_path = os.path.join(output_folder, "brand_page.txt")
        with open(brand_image_path, 'w') as f:
            f.write("This document was created with Page Raven. Learn more at https://github.com/sdabney5/PAGERAVEN\n\n")
            f.write("Page Raven Brand Page\n\n")
    
    return brand_image_path

#Function to combine pdfs (to add Page Raven ad page to the doc)
def combine_pdfs(main_file, brand_page_file, output_file):
    merger = PdfMerger()
    try:
        merger.append(brand_page_file)
        merger.append(main_file)
        merger.write(output_file)
    finally:
        merger.close()
    # Delete the original main file
    os.remove(main_file)
    # Rename the final merged file to the original specified name
    os.rename(output_file, main_file)

#Same as the combine pdfs
def combine_txts(main_file, brand_page_file, output_file):
    with open(output_file, 'w') as outfile:
        with open(brand_page_file, 'r') as infile:
            outfile.write(infile.read())
        with open(main_file, 'r') as infile:
            outfile.write(infile.read())
    # Delete the original main file
    os.remove(main_file)
    # Rename the final merged file to the original specified name
    os.rename(output_file, main_file)


#The steps for saving as a pdf--including the PageRaven brand ad page
def save_as_pdf(im_list, cover, output_file, include_default_cover=True):
 
    if include_default_cover:
        brand_image_path = decode_base64_image_to_path(default_cover_Image_brand_page, "brand_page.png")
        brand_image = Image.open(brand_image_path).convert("RGB")
        im_list.insert(0, brand_image)  # Insert the brand image as the first page
    
    if cover:
        cover.save(output_file + ".pdf", "PDF", resolution=100.0, save_all=True, append_images=im_list)
    else:
        im_list[0].save(output_file + ".pdf", "PDF", resolution=100.0, save_all=True, append_images=im_list[1:])

#Saves images as a text file, as base64 strings (hopefully useful somehow?)
def save_as_txt(im_list, output_file, include_default_cover=True):

    with open(output_file + ".txt", 'w') as f:
        if include_default_cover:
            f.write("This document was created with Page Raven. Learn more or download at https://github.com/sdabney5/PAGERAVEN\n\n")
            f.write("Page Raven Brand Page\n\n")
        
        f.write("Ebook screenshots:\n")
        for idx, img in enumerate(im_list):
            buffered = io.BytesIO()
            img.save(buffered, format="PNG")
            img_str = base64.b64encode(buffered.getvalue()).decode("utf-8")
            f.write(f"Image {idx + 1}: {img_str}\n\n")
            
            
#Decodes base 64 images to a path (for sticking the images into the gui)
def decode_base64_image_to_path(base64_string, output_path):
    image_data = base64.b64decode(base64_string)
    image = Image.open(io.BytesIO(image_data))
    image.save(output_path)


#The main screenshot function
def start_screenshot_process():
    try:
        book_length = int(book_length_entry.get())
        cover_location = cover_location_entry.get().strip()
        direction = direction_var.get()
        speed = speed_var.get()
        save_folder = save_folder_entry.get()
        book_name = book_name_entry.get()
        output_format = output_format_var.get()

        # Maps text speeds to actual values (percentage of a second between screen shots--Some apps can't flip pages quickly)
        speed_mapping = {
            "Very Slow": 2.0,
            "Slow": 1.0, 
            "Medium": 0.5,
            "Fast": 0.1,
            "Very Fast": 0.01
        }
        speed = speed_mapping[speed]

        if not os.path.isdir(save_folder):
            messagebox.showerror("Error", f"The save folder '{save_folder}' does not exist.")
            return

        output_file = os.path.join(save_folder, book_name)
        
        # Get coordinates
        global start_x, start_y, end_x, end_y
        start_x, start_y = int(x1_entry.get()), int(y1_entry.get())
        end_x, end_y = int(x2_entry.get()), int(y2_entry.get())

        box = (start_x, start_y, end_x, end_y)
        im_list = []

        # Page Raven default cover usage (this actually doesn't reall work)
        if cover_location:  
            if os.path.isfile(cover_location):
                cover = Image.open(cover_location).convert("RGB")
            else:
                messagebox.showerror("Error", f"The cover file '{cover_location}' was not found.")
                return
        else:
            # Load Page Raven ad page if no cover location specified
            #this ended up not working...The user has to specify a cover image
            default_cover_path = decode_base64_image_to_path(default_cover_Image_brand_page, "default_cover.png")
            cover = Image.open(default_cover_path).convert("RGB")

        messagebox.showinfo("Info", "Once you click okay, you will have 5 seconds to switch to your e-text reader app")
        time.sleep(5)

        for i in range(book_length):
            pag.press(direction)
            time.sleep(float(speed))
            im = ImageGrab.grab(bbox=box).convert('RGB')
            im_list.append(im)

        # Save screenshots and cover image as PDF/TXT
        if output_format == 'PDF':
            save_as_pdf(im_list, cover, output_file, include_default_cover=False)
        elif output_format == 'TXT':
            save_as_txt(im_list, output_file, include_default_cover=False)
        
        # save the brand page separately
        brand_page_path = decode_and_save_brand_page(default_cover_Image_brand_page, save_folder, output_format)
        
        # Combine the files
        if output_format == 'PDF':
            main_file = output_file + ".pdf"
            final_output = output_file + "_final.pdf"
            combine_pdfs(main_file, brand_page_path, final_output)
        elif output_format == 'TXT':
            main_file = output_file + ".txt"
            final_output = output_file + "_final.txt"
            combine_txts(main_file, brand_page_path, final_output)

        messagebox.showinfo("Info", f"Screenshots taken and saved as {output_format} successfully!")

    except ValueError as ve:
        messagebox.showerror("Error", f"Invalid input values. {ve}")
    except Exception as e:
        messagebox.showerror("Error", f"An error occurred: {e}")

#Other decode image function (for the gui)
def decode_base64_image(base64_string, width=None, height=None):
    image_data = base64.b64decode(base64_string)
    image = Image.open(io.BytesIO(image_data))
    if width and height:
        image = image.resize((width, height), Image.Resampling.LANCZOS)
    photo = ImageTk.PhotoImage(image)
    return photo


#decode base 64 icon (ico file)
def decode_base64_ico(base64_string, ico_path):
    ico_data = base64.b64decode(base64_string)
    with open(ico_path, 'wb') as ico_file:
        ico_file.write(ico_data)
